import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu.svg'

function HamburgerMenu() {
    return (
        <div id="hamburger-menu">
            <button>
                <img src={Hamburger} style="item-align:left"></img>
            </button>
        </div>
    );
}

function Navbar() {
    return (
        <header class="navbar-box navbar-border navbar-position navbar-text">
            <div id="menu">
                <HamburgerMenu />
            </div>
            <div id="header-text">
                Museum
            </div>
        </header>
    )
}


function Manytests() {
    return (
        [
            <HamburgerMenu key="ham" />,
            <Navbar key="navbar"/>
        ]
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
